import React, {Component} from 'react';

class NotFound extends Component {
    render(){
        return(
            <div>
                <img src={require('../../assets/incons/icon-notfound.svg')} alt='notfound' />
                <h3>Ops! Essa página não foi encontrada.</h3>
            </div>
        )
    }
}

export default NotFound;
